class App extends Component {

  constructor(props) {
    super(props);
    this.state = { apiResponse: "" };
  }

  callAPI() {
      fetch("http://104.128.95.54:9000/testAPI")
          .then(res => res.text())
          .then(res => this.setState({ apiResponse: res }))
          .then(err => err);
  }

  componentDidMount() {
      this.callAPI();
  }

  render(){
    return (
      <form>
        <label>Enter you name:
            <input type="text" value={this.state.apiResponse.title} />
        </label>
        <label>Enter you password:
            <input type="text" />
        </label>
        <input type="submit" />
      </form>
    );
  }
}

export default App;
